import './App.scss';
import React from 'react';
import Header from './components/Header';
import Main from './components/Main';
import Card from './components/Card';

function App() {
    return (
        <div>
            <Header />
            <Main />
            <Card
                img='./images/article-icon-1.png'
                status='SOLD OUT'
                starsAmount='5.0'
                reviewsAmount='6'
                country='USA'
                title='Life lessons with Katie Zaferes'
                price='$136'
                measure='person'
            />

            <Card
                img='./images/article-icon-2.png'
                status='ONLINE'
                starsAmount='5.0'
                reviewsAmount='30'
                country='USA'
                title='Learn wedding photography'
                price='$125'
                measure='person'
            />
        </div>
    );
}

export default App;
